import React from "react";
import { Container} from "react-bootstrap/Container";

const Favorite = ()=>{
    return(
        <Container>
            <Row>
                <Col>
                    <h1>Favorite</h1>
                </Col>
                
            </Row>
        </Container>
    )
    
}

export {Favorite}
